import React from 'react';
import {Formik,Field } from 'formik';
import {TextField} from "@material-ui/core";
import {Grid} from "@material-ui/core";
import Box from '@material-ui/core/Box';
import  *  as yup from 'yup';


const MyTextField =(props) =>{
  const [field] = useField(props);
}



const Profile = () => {
  return (
  <div className="profile">
      <Formik
       initialValues = {{firstname: '',lastName:'',email:''}} 
       onSubmit = {data =>{
        console.log(data);

        }}>

        {({values, handleChange, handleBlur, handleSubmit}) =>(
          <form onSubmit = {handleSubmit}>
             <Grid container spacing={3}>
          <Grid item xs={6} >
          <Box  margin={1}>
            <Field name="firstName" label="First Name" type = "input" as = {TextField}/>
            {/* <TextField 
            name = "firstName"
            label="First Name"
            type = "input"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            /> */}
            </Box>
            <pre>{JSON.stringify(values,null,2)}</pre>
          </Grid>

          <Grid item xs={6} >
          <Field name="lastName" label="Last Name" type = "input" as = {TextField}/>

            </Grid>

            <Grid item xs={6} >
            <Field name="email"   label="Email Address" type = "input" as = {TextField}/>
          </Grid>

          <Grid item xs={6} >
          <Field name="username"   label="Username" type = "input" as = {TextField}/>
            </Grid>



            <Grid item xs={6} >
              <Box>

              <Field name="username"   label="Username" type = "input" as = {TextField}/>

           
            </Box>
          </Grid>

          <Grid item xs={6} >
            <TextField 
            name = "username"
            label="Uname"
            type = "text"
            value = {values.firstname} 
            onChange = {handleChange} 
            onBlur = {handleBlur}
            />
            </Grid>



            </Grid>
          </form>
      )}
     </Formik>
    </div>
  );
};

export default Profile;
